const Home = () => {
  const API_URL = "https://fakestoreapi.com/products";
  const [posts , setPosts] = use

  async function fetchProductData(){
    setLoading(true);
    try{
      const res = await fetch(API_URL);
      const data = res.json();

      setPosts(data);
    }
    catch(e){
      console.log('Error Occured');
      setPosts([]);
    }

    setLoading(false);
  }

  return <div>Home</div>;
};

export default Home;
